class haxe_macro_Printer:


	def __init__(self,tabString = "\t"):
		if tabString is None:
			tabString = "\t"
		
		self.tabs = None
		self.tabString = None
		self.tabs = ""
		self.tabString = tabString
		
	
	# var tabs
	# var tabString
	def printUnop(self,op):
		if (op.index) == 0:
			return "++"
		elif (op.index) == 1:
			return "--"
		elif (op.index) == 2:
			return "!"
		elif (op.index) == 3:
			return "-"
		elif (op.index) == 4:
			return "~"
		

	def printBinop(self,op):
		if (op.index) == 0:
			return "+"
		elif (op.index) == 1:
			return "*"
		elif (op.index) == 2:
			return "/"
